import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Parse from 'parse';

const Dashboard = () => {
  const navigate = useNavigate();
  const currentUser = Parse.User.current();

  const [courses, setCourses] = useState([]);
  const [selectedCourse, setSelectedCourse] = useState(null);
  const [loading, setLoading] = useState(true);

  // Database ·Äë·Ä≤·ÄÄ ·Ä°·Äê·Äî·Ä∫·Ä∏·ÄÖ·Ä¨·Äõ·ÄÑ·Ä∫·Ä∏·Äê·ÄΩ·Ä± ·ÄÜ·ÄΩ·Ä≤·Äë·ÄØ·Äê·Ä∫·Äô·Äö·Ä∫
  useEffect(() => {
    const fetchCourses = async () => {
      const Course = Parse.Object.extend("Classes");
      const query = new Parse.Query(Course);
      try {
        const results = await query.find();
        const courseList = results.map(o => ({
          id: o.get("courseId"),
          title: o.get("title"),
          instructor: o.get("instructor"),
          zoom: o.get("zoomLink"),
          video: o.get("videoLink"),
          schedule: o.get("schedule")
        }));
        setCourses(courseList);
        if (courseList.length > 0) setSelectedCourse(courseList[0]);
        setLoading(false);
      } catch (error) {
        console.error("Error fetching courses:", error);
        setLoading(false);
      }
    };
    fetchCourses();
  }, []);

  const handleLogout = async () => {
    await Parse.User.logOut();
    navigate('/login');
  };

  if (!currentUser) return <div style={{textAlign: 'center', color: 'red', marginTop: '50px'}}>Access Denied!</div>;
  if (loading) return <div style={{textAlign: 'center', color: '#00ff41', marginTop: '50px'}}>Loading System...</div>;

  return (
    <div style={{ backgroundColor: '#0a192f', minHeight: '100vh', color: '#ccd6f6', display: 'flex', flexDirection: 'column' }}>

      {/* Top Navbar */}
      <nav style={styles.nav}>
        <h2 style={{ color: '#00ff41', margin: 0 }}>CS_SCHOOL TERMINAL</h2>
        <div style={{ display: 'flex', alignItems: 'center', gap: '20px' }}>
          <span>Agent: <span style={{color: '#00ff41'}}>{currentUser.get('username')}</span></span>
          <button onClick={handleLogout} style={styles.logoutBtn}>LOGOUT</button>
        </div>
      </nav>

      <div style={styles.contentLayout}>

        {/* Sidebar: Database ·Äô·Äæ ·Äõ·Äú·Ä¨·Äû·Ä±·Ä¨ ·Ä°·Äê·Äî·Ä∫·Ä∏·Äô·Äª·Ä¨·Ä∏ */}
        <div style={styles.sidebar}>
          <h3 style={{color: '#8892b0', fontSize: '14px', marginLeft: '10px'}}>AVAILABLE CLASSES</h3>
          {courses.map(course => (
            <div 
              key={course.id} 
              onClick={() => setSelectedCourse(course)}
              style={{
                ...styles.courseTab,
                backgroundColor: selectedCourse?.id === course.id ? '#112240' : 'transparent',
                borderLeft: selectedCourse?.id === course.id ? '4px solid #00ff41' : '4px solid transparent',
                color: selectedCourse?.id === course.id ? '#00ff41' : '#8892b0'
              }}
            >
              {course.title}
            </div>
          ))}
        </div>

        {/* Main Content: Admin ·Äê·ÄÑ·Ä∫·Äë·Ä¨·Ä∏·Äû·Ä±·Ä¨ Data ·Äô·Äª·Ä¨·Ä∏ */}
        {selectedCourse && (
          <div style={styles.mainArea}>
            <div style={styles.headerBox}>
              <h1 style={{margin: 0, color: '#00ff41'}}>{selectedCourse.title}</h1>
              <p style={{color: '#8892b0', fontSize: '18px'}}>Instructor: <span style={{color: '#fff'}}>{selectedCourse.instructor}</span></p>
              <p style={{color: '#8892b0'}}>üïí Schedule: {selectedCourse.schedule}</p>
            </div>

            <div style={styles.actionGrid}>
              {/* Zoom Link Section */}
              <div style={styles.card}>
                <h3 style={{color: '#00ff41'}}>üî¥ Live Meeting</h3>
                <p>·Ä°·ÄΩ·Äî·Ä∫·Äú·Ä≠·ÄØ·ÄÑ·Ä∫·Ä∏·Ä°·Äê·Äî·Ä∫·Ä∏ ·Äê·Ä≠·ÄØ·ÄÄ·Ä∫·Äõ·Ä≠·ÄØ·ÄÄ·Ä∫·Äê·ÄÄ·Ä∫·Äõ·Äî·Ä∫</p>
                <a href={selectedCourse.zoom} target="_blank" rel="noreferrer" style={styles.zoomBtn}>JOIN ZOOM CLASS</a>
              </div>

              {/* Video Section: YouTube Embed */}
              <div style={styles.card}>
                <h3 style={{color: '#00ff41'}}>üì∫ Lesson Record</h3>
                <div style={styles.videoWrapper}>
                  {selectedCourse.video ? (
                    <iframe 
                      src={`https://www.youtube.com/embed/${selectedCourse.video}`}
                      title="Lesson" frameBorder="0" allowFullScreen
                      style={{width: '100%', height: '200px', borderRadius: '8px', border: '1px solid #233554'}}
                    ></iframe>
                  ) : (
                    <p style={{color: '#8892b0', textAlign: 'center', padding: '50px 0'}}>No Video Uploaded Yet</p>
                  )}
                </div>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

// Styles (·Ä°·Äï·Äº·Ä±·Ä¨·ÄÑ·Ä∫·Ä∏·Ä°·Äú·Ä≤·Äô·Äõ·Äæ·Ä≠·Äï·Ä´)
const styles = {
  nav: { display: 'flex', justifyContent: 'space-between', padding: '15px 5%', background: '#112240', borderBottom: '2px solid #00ff41', alignItems: 'center' },
  logoutBtn: { background: 'transparent', color: '#ff4b2b', border: '1px solid #ff4b2b', padding: '5px 15px', borderRadius: '5px', cursor: 'pointer' },
  contentLayout: { display: 'flex', flex: 1 },
  sidebar: { width: '280px', background: '#0a192f', borderRight: '1px solid #233554', padding: '20px 10px', display: 'flex', flexDirection: 'column' },
  courseTab: { padding: '15px', cursor: 'pointer', borderRadius: '4px', marginBottom: '5px' },
  mainArea: { flex: 1, padding: '40px' },
  headerBox: { marginBottom: '30px' },
  actionGrid: { display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(350px, 1fr))', gap: '20px' },
  card: { background: '#112240', padding: '25px', borderRadius: '12px', border: '1px solid #233554' },
  zoomBtn: { display: 'block', textAlign: 'center', background: '#00ff41', color: '#0a192f', textDecoration: 'none', padding: '12px', borderRadius: '5px', fontWeight: 'bold' },
  videoWrapper: { marginTop: '15px' }
};

export default Dashboard;
